script: |
  super -f text -I q10064.spq | sort > q10064.out

inputs:
  - name: q10064.spq
    data: |
      SELECT DISTINCT - - ( + COUNT ( * ) ) FROM tab0 (FORMAT parquet) AS cor0 CROSS JOIN tab1 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab1

outputs:
  - name: q10064.out
    data: |
      9
